import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../../styles/AdminDashboard.css';

const AdminDashboard = () => {
    const navigate = useNavigate();
    const [stylists, setStylists] = useState([]);
    const [formData, setFormData] = useState({ username: '', email: '', password: '' });
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/');
            return;
        }

        // Fetch existing stylists
        axios
            .get('http://localhost:5001/api/admin/stylists', {
                headers: { Authorization: `Bearer ${token}` },
            })
            .then((response) => {
                setStylists(response.data);
                setError('');
            })
            .catch((error) => {
                console.error('Error fetching stylists:', error);
                setError(error.response?.data?.message || 'Failed to load stylists.');
            });
    }, [navigate]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        const token = localStorage.getItem('token');
        try {
            const response = await axios.post(
                'http://localhost:5001/api/users/create-stylist',
                formData,
                { headers: { Authorization: `Bearer ${token}` } }
            );
            setSuccess(response.data.message || 'Stylist created successfully!');
            setFormData({ username: '', email: '', password: '' });
            // Refresh stylist list
            const stylistsResponse = await axios.get('http://localhost:5001/api/users/stylists', {
                headers: { Authorization: `Bearer ${token}` },
            });
            setStylists(stylistsResponse.data);
            setError('');
        } catch (error) {
            console.error('Error creating stylist:', error);
            setError(error.response?.data?.message || 'Failed to create stylist.');
            setSuccess('');
        }
    };

    return (
        <div className="admin-dashboard">
            <h1>Admin Dashboard</h1>
            {error && <p className="error">{error}</p>}
            {success && <p className="success">{success}</p>}

            <div className="create-stylist">
                <h2>Create New Stylist</h2>
                <form onSubmit={handleSubmit}>
                    <div>
                        <label>Username:</label>
                        <input
                            type="text"
                            value={formData.username}
                            onChange={(e) => setFormData({ ...formData, username: e.target.value })}
                            required
                        />
                    </div>
                    <div>
                        <label>Email:</label>
                        <input
                            type="email"
                            value={formData.email}
                            onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                            required
                        />
                    </div>
                    <div>
                        <label>Password:</label>
                        <input
                            type="password"
                            value={formData.password}
                            onChange={(e) => setFormData({ ...formData, password: e.target.value })}
                            required
                        />
                    </div>
                    <button type="submit">Create Stylist</button>
                </form>
            </div>

            <div className="stylist-list">
                <h2>Existing Stylists</h2>
                {stylists.length === 0 ? (
                    <p>No stylists found.</p>
                ) : (
                    <table>
                        <thead>
                            <tr>
                                <th>Username</th>
                                <th>Email</th>
                            </tr>
                        </thead>
                        <tbody>
                            {stylists.map((stylist) => (
                                <tr key={stylist._id}>
                                    <td>{stylist.username}</td>
                                    <td>{stylist.email}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                )}
            </div>
        </div>
    );
};

export default AdminDashboard;
